window.bookSummaryJSON = "<p>On the far planet Wing IV, a brilliant scientist creates the humanoids, sleek black androids programmed to serve humanity. But are they perfect servants or perfect masters? Gradually the humanoids spread throughout the galaxy, threatening to stifle all human endeavor. Only a hidden group of rebels can stem the humanoid tide, if it’s not already too late.</p> <p>First published in <i>Astounding Science Fiction </i>during the magazine’s heyday, <i>The Humanoids</i>, science fiction grand master Jack Williamson’s finest novel, has endured for fifty years as a classic on the theme of natural versus artificial life. <i>With Folded Hands</i> continues the story.</p>"; 
